nodeLinker: node-modules

packageExtensions:
  "@firebase/auth@*":
    dependencies:
      "@firebase/app-types": "*"
      "@firebase/util": "*"
  "@firebase/database@*":
    dependencies:
      "@firebase/app": "*"
      "@firebase/app-types": "*"
  eslint-config-react-app@*:
    peerDependencies:
      eslint-plugin-flowtype: "*"
  material-table@*:
    dependencies:
      "@babel/runtime": "*"
  raw-loader@*:
    dependencies:
      webpack: "*"
  react-event-listener@*:
    dependencies:
      react: "*"
  react-frame-component@*:
    dependencies:
      prop-types: "*"
  react-redux@*:
    dependencies:
      react-dom: "*"
  react-router-config@*:
    dependencies:
      react-router: "*"
  react-table@*:
    dependencies:
      prop-types: "*"
  styled-components@*:
    dependencies:
      react-is: "*"
